and conditions of this mobile application license contained in these Terms of Use. You shall not: (1) decompile, reverse engineer, disassemble, attempt to derive the source code of, or decrypt the application; (2) make any modification, adaptation, improvement, enhancement, translation, or derivative work from the application; (3) violate any applicable laws, rules, or regulations in connection with your access or use of the application; (4) remove, alter, or obscure any proprietary notice (including any notice of copyright or trademark) posted by us or the licensors of the application; (5) use the application for any revenue generating endeavor, commercial enterprise, or other purpose for which it is not designed or intended; (6) make the application available over a network or other environment permitting access or use by multiple devices or users at the same time; (7) use the application for creating a product, service, or software that is, directly or indirectly, competitive with or in any way a substitute for the application; (8) use the application to send automated queries to any website or to send any unsolicited commercial e-mail; or (9) use any proprietary information or any of our interfaces or our other intellectual property in the design, development, manufacture, licensing, or distribution of any applications, accessories, or devices for use with the application.</p>\r\n\r\n<p>&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p><a name=\"_vzf0b5xscg\"></a><strong>Apple and Android Devices</strong></p>\r\n\r\n<p>&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>The following terms apply when you use a mobile application obtained from either the Apple Store or Google Play (each an &ldquo;App Distributor&rdquo;) to access the Site: (1) the license granted to you for our mobile application is limited to a non-transferable license to use the application on a device that utilizes the Apple iOS or Android operating systems, as applicable, and in accordance with the usage rules set forth in the applicable App Distributor&rsquo;s terms of service; (2) we are responsible for providing any maintenance and support services with respect to the mobile application as specified in the terms and conditions of this mobile application license contained in these Terms of Use or as otherwise required under applicable law, and you acknowledge that each App Distributor has no obligation whatsoever to furnish any maintenance and support services with respect to the mobile application; (3) in the event of any failure of the mobile application to conform to any applicable warranty, you may notify the applicable App Distributor, and the App Distributor, in accordance with its terms and policies, may refund the purchase price, if any, paid for the mobile application, and to the maximum extent permitted by applicable law, the App Distributor will have no other warranty obligation whatsoever with respect to the mobile application; (4) you represent and warrant that (i) you are not located in a country that is subject to a U.S. government embargo, or that has been designated by the U.S. government as a &ldquo;terrorist supporting&rdquo; country and (ii) you are not listed on any U.S. government list of prohibited or restricted parties; (5) you must comply with applicable third-party terms of agreement when using the mobile application, e.g., if you have a VoIP application, then you must not be in violation of their wireless data service agreement when using the mobile application; and (6) you acknowledge and agree that the App Distributors are third-party beneficiaries of the terms and conditions in this mobile application license contained in these Terms of Use, and that each App Distributor will have the right (and will be deemed to have accepted the right) to enforce the terms and conditions in this mobile application license contained in these Terms of Use against you as a third-party beneficiary thereof.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>SUBMISSIONS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You acknowledge and agree that any questions, comments, suggestions, ideas, feedback, or other information regarding the Site (&quot;Submissions&quot;) provided by you to us are non-confidential and shall become our sole property. We shall own exclusive rights, including all intellectual property rights, and shall be entitled to the unrestricted use and dissemination of these Submissions for any lawful purpose, commercial or otherwise, without acknowledgment or compensation to you. You hereby waive all moral rights to any such Submissions, and you hereby warrant that any such Submissions are original with you or that you have the right to submit such Submissions. You agree there shall be no recourse against us for any alleged or actual infringement or misappropriation of any proprietary right in your Submissions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><a name=\"_29ce8o9pbtmi\"></a><strong>ADVERTISERS</strong></p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>We allow advertisers to display their advertisements and other information in certain areas of the Site, such as sidebar advertisements or banner advertisements. If you are an advertiser, you shall take full responsibility for any advertisements you place on the Site and any services provided on the Site or products sold through those advertisements. Further, as an advertiser, you warrant and represent that you possess all rights and authority to place advertisements on the Site, including, but not limited to, intellectual property rights, publicity rights, and contractual rights.&nbsp;We simply provide the space to place such advertisements, and we have no other relationship with advertisers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><a name=\"_wj13r09u8u3u\"></a><strong>SITE MANAGEMENT</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We reserve the right, but not the obligation, to: (1) monitor the Site for violations of these Terms of Use; (2) take appropriate legal action against anyone who, in our sole discretion, violates the law or these Terms of Use, including without limitation, reporting such user to law enforcement authorities; (3) in our sole discretion and without limitation, refuse, restrict access to, limit the availability of, or disable (to the extent technologically feasible) any of your Contributions or any portion thereof; (4) in our sole discretion and without limitation, notice, or liability, to remove from the Site or otherwise disable all files and content that are excessive in size or are in any way burdensome to our systems; and (5) otherwise manage the Site in a manner designed to protect our rights and property and to facilitate the proper functioning of the Site.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_jugvcvcw0oj9\"></a><strong>PRIVACY POLICY</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We care about data privacy and security.&nbsp;By using the Site, you agree to be bound by our Privacy Policy posted on the Site, which is incorporated into these Terms of Use. Please be advised the Site is hosted in&nbsp;Estonia. If you access the Site from any other region of the world with laws or other requirements governing personal data collection, use, or disclosure that differ from applicable laws in&nbsp;Estonia, then through your continued use of the Site, you are transferring your data to&nbsp;Estonia, and you agree to have your data transferred to and processed in&nbsp;Estonia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_n081pott8yce\"></a><a name=\"_sg28ikxq3swh\"></a><strong>COPYRIGHT INFRINGEMENTS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We respect the intellectual property rights of others. If you believe that any material available on or through the Site infringes upon any copyright you own or control, please immediately notify us using the contact information provided below (a &ldquo;Notification&rdquo;). A copy of your Notification will be sent to the person who posted or stored the material addressed in the Notification. Please be advised that pursuant to applicable law you may be held liable for damages if you make material misrepresentations in a Notification. Thus, if you are not sure that material located on or linked to by the Site infringes your copyright, you should consider first contacting an attorney.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_k3mndam4w6w1\"></a><strong>TERM AND TERMINATION</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These Terms of Use shall remain in full force and effect while you use the Site. WITHOUT LIMITING ANY OTHER PROVISION OF THESE TERMS OF USE, WE RESERVE THE RIGHT TO, IN OUR SOLE DISCRETION AND WITHOUT NOTICE OR LIABILITY, DENY ACCESS TO AND USE OF THE SITE (INCLUDING BLOCKING CERTAIN IP ADDRESSES), TO ANY PERSON FOR ANY REASON OR FOR NO REASON, INCLUDING WITHOUT LIMITATION FOR BREACH OF ANY REPRESENTATION, WARRANTY, OR COVENANT CONTAINED IN THESE TERMS OF USE OR OF ANY APPLICABLE LAW OR REGULATION. WE MAY TERMINATE YOUR USE OR PARTICIPATION IN THE SITE OR DELETE&nbsp;YOUR ACCOUNT AND&nbsp;ANY CONTENT OR INFORMATION THAT YOU POSTED AT ANY TIME, WITHOUT WARNING, IN OUR SOLE DISCRETION.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If we terminate or suspend your account for any reason, you are prohibited from registering and creating a new account under your name, a fake or borrowed name, or the name of any third party, even if you may be acting on behalf of the third party. In addition to terminating or suspending your account, we reserve the right to take appropriate legal action, including without limitation pursuing civil, criminal, and injunctive redress.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_e2dep1hfgltt\"></a><strong>MODIFICATIONS AND INTERRUPTIONS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We reserve the right to change, modify, or remove the contents of the Site at any time or for any reason at our sole discretion without notice. However, we have no obligation to update any information on our Site. We also reserve the right to modify or discontinue all or part of the Site without notice at any time. We will not be liable to you or any third party for any modification, price change, suspension, or discontinuance of the Site. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We cannot guarantee the Site will be available at all times. We may experience hardware, software, or other problems or need to perform maintenance related to the Site, resulting in interruptions, delays, or errors. We reserve the right to change, revise, update, suspend, discontinue, or otherwise modify the Site at any time or for any reason without notice to you. You agree that we have no liability whatsoever for any loss, damage, or inconvenience caused by your inability to access or use the Site during any downtime or discontinuance of the Site. Nothing in these Terms of Use will be construed to obligate us to maintain and support the Site or to supply any corrections, updates, or releases in connection therewith.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_p6vbf8atcwhs\"></a><strong>GOVERNING LAW</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These conditions are governed by and interpreted following the laws of&nbsp;Estonia,&nbsp;and the use of the United Nations Convention of Contracts for the International Sale of Goods is expressly excluded. If your habitual residence is in the EU, and you are a consumer, you additionally possess the protection provided to you by obligatory provisions of the law of your country of residence.&nbsp;Carish O&Uuml;&nbsp;and yourself both agree to submit to the non-exclusive jurisdiction of the courts of&nbsp;Tallinn, which means that you may make a claim to defend your consumer protection rights in regards to these Conditions of Use in&nbsp;Estonia, or in the EU country in which you reside.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_v5i5tjw62cyw\"></a><strong>DISPUTE RESOLUTION</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Binding Arbitration</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Any dispute&nbsp;arising from the relationships between the parties to this contract shall be determined by one arbitrator who will be chosen in accordance with the Arbitration and Internal Rules of the European Court of Arbitration being part of the European Centre of Arbitration having its seat in Strasbourg, and which are in force at the time the application for arbitration is filed, and of which adoption of this clause constitutes acceptance. The seat of arbitration shall be&nbsp;Tallinn,&nbsp;Estonia.&nbsp;The language of the proceedings shall be&nbsp;English/ Estonian/ Russian.&nbsp;Applicable rules of substantive law shall be the law of&nbsp;Estonia.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p><a name=\"_inlv5c77dhih\"></a><strong>Restrictions</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>The Parties agree that any arbitration shall be limited to the Dispute between the Parties individually. To the full extent permitted by law, (a) no arbitration shall be joined with any other proceeding; (b) there is no right or authority for any Dispute to be arbitrated on a class-action basis or to utilize class action procedures; and (c) there is no right or authority for any Dispute to be brought in a purported representative capacity on behalf of the general public or any other persons.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p><a name=\"_mdjlt1af25uq\"></a><strong>Exceptions to Arbitration</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>The Parties agree that the following Disputes are not subject to the above provisions concerning binding arbitration: (a) any Disputes seeking to enforce or protect, or concerning the validity of, any of the intellectual property rights of a Party; (b) any Dispute related to, or arising from, allegations of theft, piracy, invasion of privacy, or unauthorized use; and (c) any claim for injunctive relief. If this provision is found to be illegal or unenforceable, then neither Party will elect to arbitrate any Dispute falling within that portion of this provision found to be illegal or unenforceable and such Dispute shall be decided by a court of competent jurisdiction within the courts listed for jurisdiction above, and the Parties agree to submit to the personal jurisdiction of that court.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_mjgzo07ttzx5\"></a><strong>CORRECTIONS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There may be information on the Site that contains typographical errors, inaccuracies, or omissions, including descriptions, pricing, availability, and various other information. We reserve the right to correct any errors, inaccuracies, or omissions and to change or update the information on the Site at any time, without prior notice.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_gvi74blrahf9\"></a><strong>DISCLAIMER</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>THE SITE IS PROVIDED ON AN AS-IS AND AS-AVAILABLE BASIS. YOU AGREE THAT YOUR USE OF THE SITE AND OUR SERVICES WILL BE AT YOUR SOLE RISK. TO THE FULLEST EXTENT PERMITTED BY LAW, WE DISCLAIM ALL WARRANTIES, EXPRESS OR IMPLIED, IN CONNECTION WITH THE SITE AND YOUR USE THEREOF, INCLUDING, WITHOUT LIMITATION, THE IMPLIED WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, AND NON-INFRINGEMENT. WE MAKE NO WARRANTIES OR REPRESENTATIONS ABOUT THE ACCURACY OR COMPLETENESS OF THE SITE&rsquo;S CONTENT OR THE CONTENT OF ANY WEBSITES LINKED TO THE SITE AND WE WILL ASSUME NO LIABILITY OR RESPONSIBILITY FOR ANY (1) ERRORS, MISTAKES, OR INACCURACIES OF CONTENT AND MATERIALS, (2) PERSONAL INJURY OR PROPERTY DAMAGE, OF ANY NATURE WHATSOEVER, RESULTING FROM YOUR ACCESS TO AND USE OF THE SITE, (3) ANY UNAUTHORIZED ACCESS TO OR USE OF OUR SECURE SERVERS AND/OR ANY AND ALL PERSONAL INFORMATION AND/OR FINANCIAL INFORMATION STORED THEREIN, (4) ANY INTERRUPTION OR CESSATION OF TRANSMISSION TO OR FROM THE SITE, (5) ANY BUGS, VIRUSES, TROJAN HORSES, OR THE LIKE WHICH MAY BE TRANSMITTED TO OR THROUGH THE SITE BY ANY THIRD PARTY, AND/OR (6) ANY ERRORS OR OMISSIONS IN ANY CONTENT AND MATERIALS OR FOR ANY LOSS OR DAMAGE OF ANY KIND INCURRED AS A RESULT OF THE USE OF ANY CONTENT POSTED, TRANSMITTED, OR OTHERWISE MADE AVAILABLE VIA THE SITE. WE DO NOT WARRANT, ENDORSE, GUARANTEE, OR ASSUME RESPONSIBILITY FOR ANY PRODUCT OR SERVICE ADVERTISED OR OFFERED BY A THIRD PARTY THROUGH THE SITE, ANY HYPERLINKED WEBSITE, OR ANY WEBSITE OR MOBILE APPLICATION FEATURED IN ANY BANNER OR OTHER ADVERTISING, AND WE WILL NOT BE A PARTY TO OR IN ANY WAY BE RESPONSIBLE FOR MONITORING ANY TRANSACTION BETWEEN YOU AND ANY THIRD-PARTY PROVIDERS OF PRODUCTS OR SERVICES. AS WITH THE PURCHASE OF A PRODUCT OR SERVICE THROUGH ANY MEDIUM OR IN ANY ENVIRONMENT, YOU SHOULD USE YOUR BEST JUDGMENT AND EXERCISE CAUTION WHERE APPROPRIATE.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_4pjah3d0455q\"></a><strong>LIMITATIONS OF LIABILITY</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>IN NO EVENT WILL WE OR OUR DIRECTORS, EMPLOYEES, OR AGENTS BE LIABLE TO YOU OR ANY THIRD PARTY FOR ANY DIRECT, INDIRECT, CONSEQUENTIAL, EXEMPLARY, INCIDENTAL, SPECIAL, OR PUNITIVE DAMAGES, INCLUDING LOST PROFIT, LOST REVENUE, LOSS OF DATA, OR OTHER DAMAGES ARISING FROM YOUR USE OF THE SITE, EVEN IF WE HAVE BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES.&nbsp;NOTWITHSTANDING ANYTHING TO THE CONTRARY CONTAINED HEREIN, OUR LIABILITY TO YOU FOR ANY CAUSE WHATSOEVER AND REGARDLESS OF THE FORM OF THE ACTION, WILL AT ALL TIMES BE LIMITED TO&nbsp;THE AMOUNT PAID, IF ANY, BY YOU TO US. CERTAIN US STATE LAWS AND INTERNATIONAL LAWS DO NOT ALLOW LIMITATIONS ON IMPLIED WARRANTIES OR THE EXCLUSION OR LIMITATION OF CERTAIN DAMAGES. IF THESE LAWS APPLY TO YOU, SOME OR ALL OF THE ABOVE DISCLAIMERS OR LIMITATIONS MAY NOT APPLY TO YOU, AND YOU MAY HAVE ADDITIONAL RIGHTS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_k5ap68aj1dd4\"></a><strong>INDEMNIFICATION</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You agree to defend, indemnify, and hold us harmless, including our subsidiaries, affiliates, and all of our respective officers, agents, partners, and employees, from and against any loss, damage, liability, claim, or demand, including reasonable attorneys&rsquo; fees and expenses, made by any third party due to or arising out of:&nbsp;(1) your Contributions;&nbsp;(2) use of the Site; (3) breach of these Terms of Use; (4) any breach of your representations and warranties set forth in these Terms of Use; (5) your violation of the rights of a third party, including but not limited to intellectual property rights; or (6) any overt harmful act toward any other user of the Site with whom you connected via the Site. Notwithstanding the foregoing, we reserve the right, at your expense, to assume the exclusive defense and control of any matter for which you are required to indemnify us, and you agree to cooperate, at your expense, with our defense of such claims. We will use reasonable efforts to notify you of any such claim, action, or proceeding which is subject to this indemnification upon becoming aware of it.</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_ftgg17oha0ep\"></a><strong>USER DATA</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We will maintain certain data that you transmit to the Site for the purpose of managing the performance of the Site, as well as data relating to your use of the Site. Although we perform regular routine backups of data, you are solely responsible for all data that you transmit or that relates to any activity you have undertaken using the Site. You agree that we shall have no liability to you for any loss or corruption of any such data, and you hereby waive any right of action against us arising from any such loss or corruption of such data.</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_dkovrslqodui\"></a><strong>ELECTRONIC COMMUNICATIONS, TRANSACTIONS, AND SIGNATURES</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Visiting the Site, sending us emails, and completing online forms constitute electronic communications. You consent to receive electronic communications, and you agree that all agreements, notices, disclosures, and other communications we provide to you electronically, via email and on the Site, satisfy any legal requirement that such communication be in writing. YOU HEREBY AGREE TO THE USE OF ELECTRONIC SIGNATURES, CONTRACTS, ORDERS, AND OTHER RECORDS, AND TO ELECTRONIC DELIVERY OF NOTICES, POLICIES, AND RECORDS OF TRANSACTIONS INITIATED OR COMPLETED BY US OR VIA THE SITE. You hereby waive any rights or requirements under any statutes, regulations, rules, ordinances, or other laws in any jurisdiction which require an original signature or delivery or retention of non-electronic records, or to payments or the granting of credits by any means other than electronic means.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_d4jvmcnxg0wt\"></a><strong>MISCELLANEOUS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These Terms of Use and any policies or operating rules posted by us on the Site or in respect to the Site constitute the entire agreement and understanding between you and us. Our failure to exercise or enforce any right or provision of these Terms of Use shall not operate as a waiver of such right or provision. These Terms of Use operate to the fullest extent permissible by law. We may assign any or all of our rights and obligations to others at any time. We shall not be responsible or liable for any loss, damage, delay, or failure to act caused by any cause beyond our reasonable control. If any provision or part of a provision of these Terms of Use is determined to be unlawful, void, or unenforceable, that provision or part of the provision is deemed severable from these Terms of Use and does not affect the validity and enforceability of any remaining provisions. There is no joint venture, partnership, employment or agency relationship created between you and us as a result of these Terms of Use or use of the Site. You agree that these Terms of Use will not be construed against us by virtue of having drafted them. You hereby waive any and all defenses you may have based on the electronic form of these Terms of Use and the lack of signing by the parties hereto to execute these Terms of Use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"_t4pq5cwn486q\"></a><strong>CONTACT US</strong><strong>&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In order to resolve a complaint regarding the Site or to receive further information regarding use of the Site, please contact us at:&nbsp;ifno@carish.ee.</p>', 3, '2020-03-01 12:52:56', '2020-11-17 06:31:33');
INSERT INTO `page_desciption` (`id`, `page_id`, `title`, `description`, `language_id`, `created_at`, `updated_at`) VALUES
(4, 2, 'Privacy Policy', '<p><strong>PRIVACY NOTICE</strong></p>\r\n\r\n<p><strong>Last updated&nbsp;04/29/2020&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for choosing to be part of our community at&nbsp;Carish O&Uuml;&nbsp;(&ldquo;company&rdquo;, &ldquo;we&rdquo;, &ldquo;us&rdquo;, or &ldquo;our&rdquo;). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about our policy, or our practices with regards to your personal information, please contact us at&nbsp;info@carish.ee</p>\r\n\r\n<p>When you visit our&nbsp;website&nbsp;<a href=\"http://www.carish.ee/\" target=\"_blank\">http://www.carish.ee</a>,&nbsp;and use our services, you trust us with your personal information. We take your privacy very seriously. In this privacy notice, we describe our privacy policy. We seek to explain to you in the clearest way possible what information we collect, how we use it and what rights you have in relation to it. We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy policy that you do not agree with, please discontinue use of our&nbsp;Sites&nbsp;and our services.</p>\r\n\r\n<p>This privacy policy applies to all information collected through our&nbsp;website&nbsp;(such as&nbsp;<a href=\"http://www.carish.ee/\" target=\"_blank\">http://www.carish.ee</a>),&nbsp;and/or any related services, sales, marketing or events (we refer to them collectively in this privacy policy as the &quot;<strong>Sites</strong>&quot;).&nbsp;</p>\r\n\r\n<p><strong>Please read this privacy policy carefully as it will help you make informed decisions about sharing your personal information with us.&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TABLE OF CONTENTS</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>1. WHAT INFORMATION DO WE COLLECT?</p>\r\n\r\n<p>2. HOW DO WE USE YOUR INFORMATION?</p>\r\n\r\n<p>3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>4. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?&nbsp;&nbsp;</p>\r\n\r\n<p>5. HOW LONG DO WE KEEP YOUR INFORMATION?</p>\r\n\r\n<p>6. HOW DO WE KEEP YOUR INFORMATION SAFE?&nbsp;&nbsp;</p>\r\n\r\n<p>7. DO WE COLLECT INFORMATION FROM MINORS?&nbsp;&nbsp;</p>\r\n\r\n<p>8. WHAT ARE YOUR PRIVACY RIGHTS?</p>\r\n\r\n<p>9. CONTROLS FOR DO-NOT-TRACK FEATURES&nbsp;</p>\r\n\r\n<p>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?&nbsp;</p>\r\n\r\n<p>11. DO WE MAKE UPDATES TO THIS POLICY?</p>\r\n\r\n<p>12. HOW CAN YOU CONTACT US ABOUT THIS POLICY?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. WHAT INFORMATION DO WE COLLECT?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personal information you disclose to us</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:</em></strong><strong>&nbsp;</strong><em>We collect personal information that you provide to us such as name, address, contact information, passwords and security data.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We collect personal information that you voluntarily provide to us when&nbsp;registering at the&nbsp;Sites&nbsp;expressing an interest in obtaining information about us or our products and services, when participating in activities on the&nbsp;Sites&nbsp;(such as posting ads in our web portal forums or sending messages to other users)&nbsp;or otherwise contacting us.</p>\r\n\r\n<p>The personal information that we collect depends on the context of your interactions with us and the&nbsp;Sites, the choices you make and the products and features you use. The personal information we collect can include the following:</p>\r\n\r\n<p><strong>Name and Contact Data.</strong>&nbsp;We collect your or your company name, email address, city/address based on the user type you selected, phone number, and other similar contact data.</p>\r\n\r\n<p><strong>Credentials.</strong>&nbsp;We collect passwords, and similar security information used for authentication and account access.</p>\r\n\r\n<p>All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information automatically collected</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:</em></strong><strong>&nbsp;</strong><em>Some information &ndash; such as IP address and/or browser and device characteristics &ndash; is collected automatically when you visit our&nbsp;Sites.</em></p>\r\n\r\n<p>We automatically collect certain information when you visit, use or navigate the&nbsp;Sites. This information does not reveal your specific identity (like your name or contact information) but may include device and usage information, such as your IP address, browser and device characteristics, operating system, language preferences, referring URLs, device name, country, location, information about how and when you use our&nbsp;Sites&nbsp;and other technical information. This information is primarily needed to maintain the security and operation of our&nbsp;Sites, and for our internal analytics and reporting purposes.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information collected from other sources</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We may collect limited data from public databases, marketing partners,&nbsp;and other outside sources.&nbsp;</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We may obtain information about you from other sources, such as public databases, joint marketing partners,&nbsp;as well as from other third parties. Examples of the information we receive from other sources include: social media profile information; marketing leads and search results and links, including paid listings (such as sponsored links).&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. HOW DO WE USE YOUR INFORMATION?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We process your information for purposes based on legitimate business interests, the fulfillment of our contract with you, compliance with our legal obligations, and/or your consent.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We use personal information collected via our&nbsp;Sites&nbsp;for a variety of business purposes described below. We process your personal information for these purposes in reliance on our legitimate business interests (&quot;Business Purposes&quot;), in order to enter into or perform a contract with you (&quot;Contractual&quot;), with your consent (&quot;Consent&quot;), and/or for compliance with our legal obligations (&quot;Legal Reasons&quot;). We indicate the specific processing grounds we rely on next to each purpose listed below.&nbsp;&nbsp;</p>\r\n\r\n<p>We use the information we collect or receive:&nbsp;&nbsp;</p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><strong>To facilitate account creation and Signup process.</strong> If you choose to link your account with us to a third party account *(such as your Google or Facebook account), we use the information you allowed us to collect from those third parties to facilitate account creation and signup process.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n	<li><strong>To enable user-to-user communications.</strong>&nbsp;We may use your information in order to enable user-to-user communications with each user&#39;s consent.&nbsp;&nbsp;</li>\r\n	<li><strong>To enforce our terms, conditions and policies.</strong></li>\r\n	<li><strong>To respond to legal requests and prevent harm.</strong>&nbsp;If we receive a subpoena or other legal request, we may need to inspect the data we hold to determine how to respond.&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We only share information with your consent, to comply with laws, to protect your rights, or to fulfill business obligations.&nbsp;</em>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may process or share data based on the following legal basis:</p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><strong>Consent:</strong>&nbsp;We may process your data if you have given us specific consent to use your personal information in a specific purpose.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Legitimate Interests:</strong>&nbsp;We may process your data when it is reasonably necessary to achieve our legitimate business interests.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Performance of a Contract:&nbsp;</strong>Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Legal Obligations:</strong>&nbsp;We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Vital Interests:</strong>&nbsp;We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.</li>\r\n</ul>\r\n\r\n<p>More specifically, we may need to process your data or share your personal information in the following situations:&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&middot; <strong>Business Transfers.</strong>&nbsp;We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.&nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&middot; <strong>Third-Party Advertisers.</strong>&nbsp;We may use third-party advertising companies to serve ads when you visit the&nbsp;Sites. These companies may use information about your visits to our Website(s) and other websites that are contained in web cookies and other tracking technologies in order to provide advertisements about goods and services of interest to you.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&middot; <strong>Other Users.</strong>&nbsp;When you share personal information&nbsp;(for example, by posting comments, contributions or other content to the&nbsp;Sites)&nbsp;or otherwise interact with public areas of the&nbsp;Sites, such personal information may be viewed by all users and may be publicly distributed outside the&nbsp;Sites&nbsp;in perpetuity.&nbsp;Similarly, other users will be able to view descriptions of your activity, communicate with you within our&nbsp;Sites, and view your profile.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We are not responsible for the safety of any information that you share with third-party providers who advertise, but are not affiliated with, our websites.&nbsp;</em>&nbsp;</p>\r\n\r\n<p>The&nbsp;Sites&nbsp;may contain advertisements from third parties that are not affiliated with us and which may link to other websites, online services or mobile applications. We cannot guarantee the safety and privacy of data you provide to any third parties. Any data collected by third parties is not covered by this privacy policy. We are not responsible for the content or privacy and security practices and policies of any third parties, including other websites, services or applications that may be linked to or from the&nbsp;Sites. You should review the policies of such third parties and contact them directly to respond to your questions.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5. HOW LONG DO WE KEEP YOUR INFORMATION?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We keep your information for as long as necessary to fulfill the purposes outlined in this privacy policy unless otherwise required by law.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We will only keep your personal information for as long as it is necessary for the purposes set out in this privacy policy, unless a longer retention period is required or permitted by law (such as tax, accounting or other legal requirements). No purpose in this policy will require us keeping your personal information for longer than&nbsp;the period of time in which users have an account with us.</p>\r\n\r\n<p>When we have no ongoing legitimate business need to process your personal information, we will either delete or anonymize it, or, if this is not possible (for example, because your personal information has been stored in backup archives), then we will securely store your personal information and isolate it from any further processing until deletion is possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6. HOW DO WE KEEP YOUR INFORMATION SAFE?&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We aim to protect your personal information through a system of organizational and technical security measures.</em>&nbsp;</p>\r\n\r\n<p>We have implemented appropriate technical and organizational security measures designed to protect the security of any personal information we process. However, please also remember that we cannot guarantee that the internet itself is 100% secure. Although we will do our best to protect your personal information, transmission of personal information to and from our&nbsp;Sites&nbsp;is at your own risk. You should only access the services within a secure environment.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7. DO WE COLLECT INFORMATION FROM MINORS?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We do not knowingly collect data from or market to children under 18 years of age.</em></p>\r\n\r\n<p>We do not knowingly solicit data from or market to children under 18 years of age. By using the&nbsp;Sites, you represent that you are at least 18 or that you are the parent or guardian of such a minor and consent to such minor dependent&rsquo;s use of the&nbsp;Sites. If we learn that personal information from users less than 18 years of age has been collected, we will deactivate the account and take reasonable measures to promptly delete such data from our records. If you become aware of any data we have collected from children under age 18, please contact us at&nbsp;info@carish.ee.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>8. WHAT ARE YOUR PRIVACY RIGHTS?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>In some regions, such as the European Economic Area, you have rights that allow you greater access to and control over your personal information. You may review, change, or terminate your account at any time.</em></p>\r\n\r\n<p>In some regions (like the European Economic Area), you have certain rights under applicable data protection laws.</p>\r\n\r\n<p>These may include the right</p>\r\n\r\n<ul>\r\n	<li>to request access and obtain a copy of your personal information,</li>\r\n	<li>to request rectification or erasure,</li>\r\n	<li>to restrict the processing of your personal information; and</li>\r\n	<li>if applicable, to data portability. In certain circumstances, you may also have the right to object to the processing of your personal information.</li>\r\n</ul>\r\n\r\n<p>&nbsp;To make such a request, please use the&nbsp;<a href=\"https://app.termly.io/dashboard/website/418252/privacy-policy#contact\">contact details</a>&nbsp;provided below. We will consider and act upon any request in accordance with applicable data protection laws.&nbsp;</p>\r\n\r\n<p>If we are relying on your consent to process your personal information, you have the right to withdraw your consent at any time. Please note however that this will not affect the lawfulness of the processing before its withdrawal.</p>\r\n\r\n<p>If you are resident in the European Economic Area and you believe we are unlawfully processing your personal information, you also have the right to complain to your local data protection supervisory authority. You can find their contact details here:&nbsp;<a href=\"http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm\" target=\"_blank\">http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm</a>&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Account Information</strong>&nbsp;</p>\r\n\r\n<p>If you would at any time like to review or change the information in your account or terminate your account, you can:&nbsp;&nbsp;</p>\r\n\r\n<p>■ Login to your account settings and update your user account.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Upon your request to terminate your account, we will deactivate or delete your account and information from our active databases. However, some information may be retained in our files to prevent fraud, troubleshoot problems, assist with any investigations, enforce our Terms of Use and/or comply with legal requirements.&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Opting out of email marketing:&nbsp;</strong>You can unsubscribe from our marketing email list at any time by clicking on the unsubscribe link in the emails that we send or by contacting us using the details provided below. You will then be removed from the marketing email list &ndash; however, we will still need to send you service-related emails that are necessary for the administration and use of your account. To otherwise opt-out, you may:&nbsp;&nbsp;</p>\r\n\r\n<p>■ Access your account settings and update preferences.</p>\r\n\r\n<p><strong>9. CONTROLS FOR DO-NOT-TRACK FEATURES</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>Most web browsers and some mobile operating systems and mobile applications include a Do-Not-Track (&ldquo;DNT&rdquo;) feature or setting you can activate to signal your privacy preference not to have data about your online browsing activities monitored and collected. No uniform technology standard for recognizing and implementing DNT signals has been finalized. As such, we do not currently respond to DNT browser signals or any other mechanism that automatically communicates your choice not to be tracked online. If a standard for online tracking is adopted that we must follow in the future, we will inform you about that practice in a revised version of this Privacy Policy.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>Yes, if you are a resident of California, you are granted specific rights regarding access to your personal information.&nbsp;</em>&nbsp;</p>\r\n\r\n<p>California Civil Code Section 1798.83, also known as the &ldquo;Shine The Light&rdquo; law, permits our users who are California residents to request and obtain from us, once a year and free of charge, information about categories of personal information (if any) we disclosed to third parties for direct marketing purposes and the names and addresses of all third parties with which we shared personal information in the immediately preceding calendar year. If you are a California resident and would like to make such a request, please submit your request in writing to us using the contact information provided below.&nbsp;</p>\r\n\r\n<p>If you are under 18 years of age, reside in California, and have a registered account with the&nbsp;Sites, you have the right to request removal of unwanted data that you publicly post on the&nbsp;Sites. To request removal of such data, please contact us using the contact information provided below, and include the email address associated with your account and a statement that you reside in California. We will make sure the data is not publicly displayed on the&nbsp;Sites, but please be aware that the data may not be completely or comprehensively removed from our systems.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>11. DO WE MAKE UPDATES TO THIS POLICY?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>Yes, we will update this policy as necessary to stay compliant with relevant laws.</em></p>\r\n\r\n<p>We may update this privacy policy from time to time. The updated version will be indicated by an updated &ldquo;Revised&rdquo; date and the updated version will be effective as soon as it is accessible. If we make material changes to this privacy policy, we may notify you either by prominently posting a notice of such changes or by directly sending you a notification. We encourage you to review this privacy policy frequently to be informed of how we are protecting your information.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>12. HOW CAN YOU CONTACT US ABOUT THIS POLICY?</strong></p>\r\n\r\n<p>If you have questions or comments about this policy, you may&nbsp;email us at&nbsp;info@carish.ee&nbsp;or by phone # : +372 58777537.</p>', 1, '2020-03-01 12:55:11', '2020-11-17 06:32:26'),
(5, 2, 'Privacy Policy', '<p><strong>PRIVACY NOTICE</strong></p>\r\n\r\n<p><strong>Last updated&nbsp;04/29/2020&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for choosing to be part of our community at&nbsp;Carish O&Uuml;&nbsp;(&ldquo;company&rdquo;, &ldquo;we&rdquo;, &ldquo;us&rdquo;, or &ldquo;our&rdquo;). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about our policy, or our practices with regards to your personal information, please contact us at&nbsp;info@carish.ee</p>\r\n\r\n<p>When you visit our&nbsp;website&nbsp;<a href=\"http://www.carish.ee/\" target=\"_blank\">http://www.carish.ee</a>,&nbsp;and use our services, you trust us with your personal information. We take your privacy very seriously. In this privacy notice, we describe our privacy policy. We seek to explain to you in the clearest way possible what information we collect, how we use it and what rights you have in relation to it. We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy policy that you do not agree with, please discontinue use of our&nbsp;Sites&nbsp;and our services.</p>\r\n\r\n<p>This privacy policy applies to all information collected through our&nbsp;website&nbsp;(such as&nbsp;<a href=\"http://www.carish.ee/\" target=\"_blank\">http://www.carish.ee</a>),&nbsp;and/or any related services, sales, marketing or events (we refer to them collectively in this privacy policy as the &quot;<strong>Sites</strong>&quot;).&nbsp;</p>\r\n\r\n<p><strong>Please read this privacy policy carefully as it will help you make informed decisions about sharing your personal information with us.&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TABLE OF CONTENTS</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>1. WHAT INFORMATION DO WE COLLECT?</p>\r\n\r\n<p>2. HOW DO WE USE YOUR INFORMATION?</p>\r\n\r\n<p>3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>4. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?&nbsp;&nbsp;</p>\r\n\r\n<p>5. HOW LONG DO WE KEEP YOUR INFORMATION?</p>\r\n\r\n<p>6. HOW DO WE KEEP YOUR INFORMATION SAFE?&nbsp;&nbsp;</p>\r\n\r\n<p>7. DO WE COLLECT INFORMATION FROM MINORS?&nbsp;&nbsp;</p>\r\n\r\n<p>8. WHAT ARE YOUR PRIVACY RIGHTS?</p>\r\n\r\n<p>9. CONTROLS FOR DO-NOT-TRACK FEATURES&nbsp;</p>\r\n\r\n<p>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?&nbsp;</p>\r\n\r\n<p>11. DO WE MAKE UPDATES TO THIS POLICY?</p>\r\n\r\n<p>12. HOW CAN YOU CONTACT US ABOUT THIS POLICY?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. WHAT INFORMATION DO WE COLLECT?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personal information you disclose to us</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:</em></strong><strong>&nbsp;</strong><em>We collect personal information that you provide to us such as name, address, contact information, passwords and security data.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We collect personal information that you voluntarily provide to us when&nbsp;registering at the&nbsp;Sites&nbsp;expressing an interest in obtaining information about us or our products and services, when participating in activities on the&nbsp;Sites&nbsp;(such as posting ads in our web portal forums or sending messages to other users)&nbsp;or otherwise contacting us.</p>\r\n\r\n<p>The personal information that we collect depends on the context of your interactions with us and the&nbsp;Sites, the choices you make and the products and features you use. The personal information we collect can include the following:</p>\r\n\r\n<p><strong>Name and Contact Data.</strong>&nbsp;We collect your or your company name, email address, city/address based on the user type you selected, phone number, and other similar contact data.</p>\r\n\r\n<p><strong>Credentials.</strong>&nbsp;We collect passwords, and similar security information used for authentication and account access.</p>\r\n\r\n<p>All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information automatically collected</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:</em></strong><strong>&nbsp;</strong><em>Some information &ndash; such as IP address and/or browser and device characteristics &ndash; is collected automatically when you visit our&nbsp;Sites.</em></p>\r\n\r\n<p>We automatically collect certain information when you visit, use or navigate the&nbsp;Sites. This information does not reveal your specific identity (like your name or contact information) but may include device and usage information, such as your IP address, browser and device characteristics, operating system, language preferences, referring URLs, device name, country, location, information about how and when you use our&nbsp;Sites&nbsp;and other technical information. This information is primarily needed to maintain the security and operation of our&nbsp;Sites, and for our internal analytics and reporting purposes.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information collected from other sources</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We may collect limited data from public databases, marketing partners,&nbsp;and other outside sources.&nbsp;</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We may obtain information about you from other sources, such as public databases, joint marketing partners,&nbsp;as well as from other third parties. Examples of the information we receive from other sources include: social media profile information; marketing leads and search results and links, including paid listings (such as sponsored links).&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. HOW DO WE USE YOUR INFORMATION?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We process your information for purposes based on legitimate business interests, the fulfillment of our contract with you, compliance with our legal obligations, and/or your consent.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We use personal information collected via our&nbsp;Sites&nbsp;for a variety of business purposes described below. We process your personal information for these purposes in reliance on our legitimate business interests (&quot;Business Purposes&quot;), in order to enter into or perform a contract with you (&quot;Contractual&quot;), with your consent (&quot;Consent&quot;), and/or for compliance with our legal obligations (&quot;Legal Reasons&quot;). We indicate the specific processing grounds we rely on next to each purpose listed below.&nbsp;&nbsp;</p>\r\n\r\n<p>We use the information we collect or receive:&nbsp;&nbsp;</p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><strong>To facilitate account creation and Signup process.</strong> If you choose to link your account with us to a third party account *(such as your Google or Facebook account), we use the information you allowed us to collect from those third parties to facilitate account creation and signup process.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n	<li><strong>To enable user-to-user communications.</strong>&nbsp;We may use your information in order to enable user-to-user communications with each user&#39;s consent.&nbsp;&nbsp;</li>\r\n	<li><strong>To enforce our terms, conditions and policies.</strong></li>\r\n	<li><strong>To respond to legal requests and prevent harm.</strong>&nbsp;If we receive a subpoena or other legal request, we may need to inspect the data we hold to determine how to respond.&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We only share information with your consent, to comply with laws, to protect your rights, or to fulfill business obligations.&nbsp;</em>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may process or share data based on the following legal basis:</p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><strong>Consent:</strong>&nbsp;We may process your data if you have given us specific consent to use your personal information in a specific purpose.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Legitimate Interests:</strong>&nbsp;We may process your data when it is reasonably necessary to achieve our legitimate business interests.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Performance of a Contract:&nbsp;</strong>Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Legal Obligations:</strong>&nbsp;We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Vital Interests:</strong>&nbsp;We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.</li>\r\n</ul>\r\n\r\n<p>More specifically, we may need to process your data or share your personal information in the following situations:&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&middot; <strong>Business Transfers.</strong>&nbsp;We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.&nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&middot; <strong>Third-Party Advertisers.</strong>&nbsp;We may use third-party advertising companies to serve ads when you visit the&nbsp;Sites. These companies may use information about your visits to our Website(s) and other websites that are contained in web cookies and other tracking technologies in order to provide advertisements about goods and services of interest to you.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&middot; <strong>Other Users.</strong>&nbsp;When you share personal information&nbsp;(for example, by posting comments, contributions or other content to the&nbsp;Sites)&nbsp;or otherwise interact with public areas of the&nbsp;Sites, such personal information may be viewed by all users and may be publicly distributed outside the&nbsp;Sites&nbsp;in perpetuity.&nbsp;Similarly, other users will be able to view descriptions of your activity, communicate with you within our&nbsp;Sites, and view your profile.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We are not responsible for the safety of any information that you share with third-party providers who advertise, but are not affiliated with, our websites.&nbsp;</em>&nbsp;</p>\r\n\r\n<p>The&nbsp;Sites&nbsp;may contain advertisements from third parties that are not affiliated with us and which may link to other websites, online services or mobile applications. We cannot guarantee the safety and privacy of data you provide to any third parties. Any data collected by third parties is not covered by this privacy policy. We are not responsible for the content or privacy and security practices and policies of any third parties, including other websites, services or applications that may be linked to or from the&nbsp;Sites. You should review the policies of such third parties and contact them directly to respond to your questions.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5. HOW LONG DO WE KEEP YOUR INFORMATION?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We keep your information for as long as necessary to fulfill the purposes outlined in this privacy policy unless otherwise required by law.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We will only keep your personal information for as long as it is necessary for the purposes set out in this privacy policy, unless a longer retention period is required or permitted by law (such as tax, accounting or other legal requirements). No purpose in this policy will require us keeping your personal information for longer than&nbsp;the period of time in which users have an account with us.</p>\r\n\r\n<p>When we have no ongoing legitimate business need to process your personal information, we will either delete or anonymize it, or, if this is not possible (for example, because your personal information has been stored in backup archives), then we will securely store your personal information and isolate it from any further processing until deletion is possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6. HOW DO WE KEEP YOUR INFORMATION SAFE?&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We aim to protect your personal information through a system of organizational and technical security measures.</em>&nbsp;</p>\r\n\r\n<p>We have implemented appropriate technical and organizational security measures designed to protect the security of any personal information we process. However, please also remember that we cannot guarantee that the internet itself is 100% secure. Although we will do our best to protect your personal information, transmission of personal information to and from our&nbsp;Sites&nbsp;is at your own risk. You should only access the services within a secure environment.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7. DO WE COLLECT INFORMATION FROM MINORS?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We do not knowingly collect data from or market to children under 18 years of age.</em></p>\r\n\r\n<p>We do not knowingly solicit data from or market to children under 18 years of age. By using the&nbsp;Sites, you represent that you are at least 18 or that you are the parent or guardian of such a minor and consent to such minor dependent&rsquo;s use of the&nbsp;Sites. If we learn that personal information from users less than 18 years of age has been collected, we will deactivate the account and take reasonable measures to promptly delete such data from our records. If you become aware of any data we have collected from children under age 18, please contact us at&nbsp;info@carish.ee.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>8. WHAT ARE YOUR PRIVACY RIGHTS?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>In some regions, such as the European Economic Area, you have rights that allow you greater access to and control over your personal information. You may review, change, or terminate your account at any time.</em></p>\r\n\r\n<p>In some regions (like the European Economic Area), you have certain rights under applicable data protection laws.</p>\r\n\r\n<p>These may include the right</p>\r\n\r\n<ul>\r\n	<li>to request access and obtain a copy of your personal information,</li>\r\n	<li>to request rectification or erasure,</li>\r\n	<li>to restrict the processing of your personal information; and</li>\r\n	<li>if applicable, to data portability. In certain circumstances, you may also have the right to object to the processing of your personal information.</li>\r\n</ul>\r\n\r\n<p>&nbsp;To make such a request, please use the&nbsp;<a href=\"https://app.termly.io/dashboard/website/418252/privacy-policy#contact\">contact details</a>&nbsp;provided below. We will consider and act upon any request in accordance with applicable data protection laws.&nbsp;</p>\r\n\r\n<p>If we are relying on your consent to process your personal information, you have the right to withdraw your consent at any time. Please note however that this will not affect the lawfulness of the processing before its withdrawal.</p>\r\n\r\n<p>If you are resident in the European Economic Area and you believe we are unlawfully processing your personal information, you also have the right to complain to your local data protection supervisory authority. You can find their contact details here:&nbsp;<a href=\"http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm\" target=\"_blank\">http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm</a>&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Account Information</strong>&nbsp;</p>\r\n\r\n<p>If you would at any time like to review or change the information in your account or terminate your account, you can:&nbsp;&nbsp;</p>\r\n\r\n<p>■ Login to your account settings and update your user account.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Upon your request to terminate your account, we will deactivate or delete your account and information from our active databases. However, some information may be retained in our files to prevent fraud, troubleshoot problems, assist with any investigations, enforce our Terms of Use and/or comply with legal requirements.&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Opting out of email marketing:&nbsp;</strong>You can unsubscribe from our marketing email list at any time by clicking on the unsubscribe link in the emails that we send or by contacting us using the details provided below. You will then be removed from the marketing email list &ndash; however, we will still need to send you service-related emails that are necessary for the administration and use of your account. To otherwise opt-out, you may:&nbsp;&nbsp;</p>\r\n\r\n<p>■ Access your account settings and update preferences.</p>\r\n\r\n<p><strong>9. CONTROLS FOR DO-NOT-TRACK FEATURES</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>Most web browsers and some mobile operating systems and mobile applications include a Do-Not-Track (&ldquo;DNT&rdquo;) feature or setting you can activate to signal your privacy preference not to have data about your online browsing activities monitored and collected. No uniform technology standard for recognizing and implementing DNT signals has been finalized. As such, we do not currently respond to DNT browser signals or any other mechanism that automatically communicates your choice not to be tracked online. If a standard for online tracking is adopted that we must follow in the future, we will inform you about that practice in a revised version of this Privacy Policy.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>Yes, if you are a resident of California, you are granted specific rights regarding access to your personal information.&nbsp;</em>&nbsp;</p>\r\n\r\n<p>California Civil Code Section 1798.83, also known as the &ldquo;Shine The Light&rdquo; law, permits our users who are California residents to request and obtain from us, once a year and free of charge, information about categories of personal information (if any) we disclosed to third parties for direct marketing purposes and the names and addresses of all third parties with which we shared personal information in the immediately preceding calendar year. If you are a California resident and would like to make such a request, please submit your request in writing to us using the contact information provided below.&nbsp;</p>\r\n\r\n<p>If you are under 18 years of age, reside in California, and have a registered account with the&nbsp;Sites, you have the right to request removal of unwanted data that you publicly post on the&nbsp;Sites. To request removal of such data, please contact us using the contact information provided below, and include the email address associated with your account and a statement that you reside in California. We will make sure the data is not publicly displayed on the&nbsp;Sites, but please be aware that the data may not be completely or comprehensively removed from our systems.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>11. DO WE MAKE UPDATES TO THIS POLICY?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>Yes, we will update this policy as necessary to stay compliant with relevant laws.</em></p>\r\n\r\n<p>We may update this privacy policy from time to time. The updated version will be indicated by an updated &ldquo;Revised&rdquo; date and the updated version will be effective as soon as it is accessible. If we make material changes to this privacy policy, we may notify you either by prominently posting a notice of such changes or by directly sending you a notification. We encourage you to review this privacy policy frequently to be informed of how we are protecting your information.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>12. HOW CAN YOU CONTACT US ABOUT THIS POLICY?</strong></p>\r\n\r\n<p>If you have questions or comments about this policy, you may&nbsp;email us at&nbsp;info@carish.ee&nbsp;or by phone # : +372 58777537.</p>', 2, '2020-03-01 12:55:11', '2020-11-17 06:32:26');
INSERT INTO `page_desciption` (`id`, `page_id`, `title`, `description`, `language_id`, `created_at`, `updated_at`) VALUES
(6, 2, 'Privacy Policy', '<p><strong>PRIVACY NOTICE</strong></p>\r\n\r\n<p><strong>Last updated&nbsp;04/29/2020&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for choosing to be part of our community at&nbsp;Carish O&Uuml;&nbsp;(&ldquo;company&rdquo;, &ldquo;we&rdquo;, &ldquo;us&rdquo;, or &ldquo;our&rdquo;). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about our policy, or our practices with regards to your personal information, please contact us at&nbsp;info@carish.ee</p>\r\n\r\n<p>When you visit our&nbsp;website&nbsp;<a href=\"http://www.carish.ee/\" target=\"_blank\">http://www.carish.ee</a>,&nbsp;and use our services, you trust us with your personal information. We take your privacy very seriously. In this privacy notice, we describe our privacy policy. We seek to explain to you in the clearest way possible what information we collect, how we use it and what rights you have in relation to it. We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy policy that you do not agree with, please discontinue use of our&nbsp;Sites&nbsp;and our services.</p>\r\n\r\n<p>This privacy policy applies to all information collected through our&nbsp;website&nbsp;(such as&nbsp;<a href=\"http://www.carish.ee/\" target=\"_blank\">http://www.carish.ee</a>),&nbsp;and/or any related services, sales, marketing or events (we refer to them collectively in this privacy policy as the &quot;<strong>Sites</strong>&quot;).&nbsp;</p>\r\n\r\n<p><strong>Please read this privacy policy carefully as it will help you make informed decisions about sharing your personal information with us.&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TABLE OF CONTENTS</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>1. WHAT INFORMATION DO WE COLLECT?</p>\r\n\r\n<p>2. HOW DO WE USE YOUR INFORMATION?</p>\r\n\r\n<p>3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>4. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?&nbsp;&nbsp;</p>\r\n\r\n<p>5. HOW LONG DO WE KEEP YOUR INFORMATION?</p>\r\n\r\n<p>6. HOW DO WE KEEP YOUR INFORMATION SAFE?&nbsp;&nbsp;</p>\r\n\r\n<p>7. DO WE COLLECT INFORMATION FROM MINORS?&nbsp;&nbsp;</p>\r\n\r\n<p>8. WHAT ARE YOUR PRIVACY RIGHTS?</p>\r\n\r\n<p>9. CONTROLS FOR DO-NOT-TRACK FEATURES&nbsp;</p>\r\n\r\n<p>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?&nbsp;</p>\r\n\r\n<p>11. DO WE MAKE UPDATES TO THIS POLICY?</p>\r\n\r\n<p>12. HOW CAN YOU CONTACT US ABOUT THIS POLICY?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. WHAT INFORMATION DO WE COLLECT?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personal information you disclose to us</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:</em></strong><strong>&nbsp;</strong><em>We collect personal information that you provide to us such as name, address, contact information, passwords and security data.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We collect personal information that you voluntarily provide to us when&nbsp;registering at the&nbsp;Sites&nbsp;expressing an interest in obtaining information about us or our products and services, when participating in activities on the&nbsp;Sites&nbsp;(such as posting ads in our web portal forums or sending messages to other users)&nbsp;or otherwise contacting us.</p>\r\n\r\n<p>The personal information that we collect depends on the context of your interactions with us and the&nbsp;Sites, the choices you make and the products and features you use. The personal information we collect can include the following:</p>\r\n\r\n<p><strong>Name and Contact Data.</strong>&nbsp;We collect your or your company name, email address, city/address based on the user type you selected, phone number, and other similar contact data.</p>\r\n\r\n<p><strong>Credentials.</strong>&nbsp;We collect passwords, and similar security information used for authentication and account access.</p>\r\n\r\n<p>All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information automatically collected</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:</em></strong><strong>&nbsp;</strong><em>Some information &ndash; such as IP address and/or browser and device characteristics &ndash; is collected automatically when you visit our&nbsp;Sites.</em></p>\r\n\r\n<p>We automatically collect certain information when you visit, use or navigate the&nbsp;Sites. This information does not reveal your specific identity (like your name or contact information) but may include device and usage information, such as your IP address, browser and device characteristics, operating system, language preferences, referring URLs, device name, country, location, information about how and when you use our&nbsp;Sites&nbsp;and other technical information. This information is primarily needed to maintain the security and operation of our&nbsp;Sites, and for our internal analytics and reporting purposes.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information collected from other sources</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We may collect limited data from public databases, marketing partners,&nbsp;and other outside sources.&nbsp;</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We may obtain information about you from other sources, such as public databases, joint marketing partners,&nbsp;as well as from other third parties. Examples of the information we receive from other sources include: social media profile information; marketing leads and search results and links, including paid listings (such as sponsored links).&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. HOW DO WE USE YOUR INFORMATION?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We process your information for purposes based on legitimate business interests, the fulfillment of our contract with you, compliance with our legal obligations, and/or your consent.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We use personal information collected via our&nbsp;Sites&nbsp;for a variety of business purposes described below. We process your personal information for these purposes in reliance on our legitimate business interests (&quot;Business Purposes&quot;), in order to enter into or perform a contract with you (&quot;Contractual&quot;), with your consent (&quot;Consent&quot;), and/or for compliance with our legal obligations (&quot;Legal Reasons&quot;). We indicate the specific processing grounds we rely on next to each purpose listed below.&nbsp;&nbsp;</p>\r\n\r\n<p>We use the information we collect or receive:&nbsp;&nbsp;</p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><strong>To facilitate account creation and Signup process.</strong> If you choose to link your account with us to a third party account *(such as your Google or Facebook account), we use the information you allowed us to collect from those third parties to facilitate account creation and signup process.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n	<li><strong>To enable user-to-user communications.</strong>&nbsp;We may use your information in order to enable user-to-user communications with each user&#39;s consent.&nbsp;&nbsp;</li>\r\n	<li><strong>To enforce our terms, conditions and policies.</strong></li>\r\n	<li><strong>To respond to legal requests and prevent harm.</strong>&nbsp;If we receive a subpoena or other legal request, we may need to inspect the data we hold to determine how to respond.&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We only share information with your consent, to comply with laws, to protect your rights, or to fulfill business obligations.&nbsp;</em>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may process or share data based on the following legal basis:</p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li><strong>Consent:</strong>&nbsp;We may process your data if you have given us specific consent to use your personal information in a specific purpose.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Legitimate Interests:</strong>&nbsp;We may process your data when it is reasonably necessary to achieve our legitimate business interests.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Performance of a Contract:&nbsp;</strong>Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Legal Obligations:</strong>&nbsp;We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).&nbsp;<br />\r\n	<br />\r\n	&nbsp;</li>\r\n	<li><strong>Vital Interests:</strong>&nbsp;We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.</li>\r\n</ul>\r\n\r\n<p>More specifically, we may need to process your data or share your personal information in the following situations:&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&middot; <strong>Business Transfers.</strong>&nbsp;We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.&nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&middot; <strong>Third-Party Advertisers.</strong>&nbsp;We may use third-party advertising companies to serve ads when you visit the&nbsp;Sites. These companies may use information about your visits to our Website(s) and other websites that are contained in web cookies and other tracking technologies in order to provide advertisements about goods and services of interest to you.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&middot; <strong>Other Users.</strong>&nbsp;When you share personal information&nbsp;(for example, by posting comments, contributions or other content to the&nbsp;Sites)&nbsp;or otherwise interact with public areas of the&nbsp;Sites, such personal information may be viewed by all users and may be publicly distributed outside the&nbsp;Sites&nbsp;in perpetuity.&nbsp;Similarly, other users will be able to view descriptions of your activity, communicate with you within our&nbsp;Sites, and view your profile.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We are not responsible for the safety of any information that you share with third-party providers who advertise, but are not affiliated with, our websites.&nbsp;</em>&nbsp;</p>\r\n\r\n<p>The&nbsp;Sites&nbsp;may contain advertisements from third parties that are not affiliated with us and which may link to other websites, online services or mobile applications. We cannot guarantee the safety and privacy of data you provide to any third parties. Any data collected by third parties is not covered by this privacy policy. We are not responsible for the content or privacy and security practices and policies of any third parties, including other websites, services or applications that may be linked to or from the&nbsp;Sites. You should review the policies of such third parties and contact them directly to respond to your questions.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5. HOW LONG DO WE KEEP YOUR INFORMATION?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We keep your information for as long as necessary to fulfill the purposes outlined in this privacy policy unless otherwise required by law.</em>&nbsp;&nbsp;</p>\r\n\r\n<p>We will only keep your personal information for as long as it is necessary for the purposes set out in this privacy policy, unless a longer retention period is required or permitted by law (such as tax, accounting or other legal requirements). No purpose in this policy will require us keeping your personal information for longer than&nbsp;the period of time in which users have an account with us.</p>\r\n\r\n<p>When we have no ongoing legitimate business need to process your personal information, we will either delete or anonymize it, or, if this is not possible (for example, because your personal information has been stored in backup archives), then we will securely store your personal information and isolate it from any further processing until deletion is possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6. HOW DO WE KEEP YOUR INFORMATION SAFE?&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We aim to protect your personal information through a system of organizational and technical security measures.</em>&nbsp;</p>\r\n\r\n<p>We have implemented appropriate technical and organizational security measures designed to protect the security of any personal information we process. However, please also remember that we cannot guarantee that the internet itself is 100% secure. Although we will do our best to protect your personal information, transmission of personal information to and from our&nbsp;Sites&nbsp;is at your own risk. You should only access the services within a secure environment.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7. DO WE COLLECT INFORMATION FROM MINORS?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>We do not knowingly collect data from or market to children under 18 years of age.</em></p>\r\n\r\n<p>We do not knowingly solicit data from or market to children under 18 years of age. By using the&nbsp;Sites, you represent that you are at least 18 or that you are the parent or guardian of such a minor and consent to such minor dependent&rsquo;s use of the&nbsp;Sites. If we learn that personal information from users less than 18 years of age has been collected, we will deactivate the account and take reasonable measures to promptly delete such data from our records. If you become aware of any data we have collected from children under age 18, please contact us at&nbsp;info@carish.ee.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>8. WHAT ARE YOUR PRIVACY RIGHTS?</strong><strong>&nbsp;</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>In some regions, such as the European Economic Area, you have rights that allow you greater access to and control over your personal information. You may review, change, or terminate your account at any time.</em></p>\r\n\r\n<p>In some regions (like the European Economic Area), you have certain rights under applicable data protection laws.</p>\r\n\r\n<p>These may include the right</p>\r\n\r\n<ul>\r\n	<li>to request access and obtain a copy of your personal information,</li>\r\n	<li>to request rectification or erasure,</li>\r\n	<li>to restrict the processing of your personal information; and</li>\r\n	<li>if applicable, to data portability. In certain circumstances, you may also have the right to object to the processing of your personal information.</li>\r\n</ul>\r\n\r\n<p>&nbsp;To make such a request, please use the&nbsp;<a href=\"https://app.termly.io/dashboard/website/418252/privacy-policy#contact\">contact details</a>&nbsp;provided below. We will consider and act upon any request in accordance with applicable data protection laws.&nbsp;</p>\r\n\r\n<p>If we are relying on your consent to process your personal information, you have the right to withdraw your consent at any time. Please note however that this will not affect the lawfulness of the processing before its withdrawal.</p>\r\n\r\n<p>If you are resident in the European Economic Area and you believe we are unlawfully processing your personal information, you also have the right to complain to your local data protection supervisory authority. You can find their contact details here:&nbsp;<a href=\"http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm\" target=\"_blank\">http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm</a>&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Account Information</strong>&nbsp;</p>\r\n\r\n<p>If you would at any time like to review or change the information in your account or terminate your account, you can:&nbsp;&nbsp;</p>\r\n\r\n<p>■ Login to your account settings and update your user account.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Upon your request to terminate your account, we will deactivate or delete your account and information from our active databases. However, some information may be retained in our files to prevent fraud, troubleshoot problems, assist with any investigations, enforce our Terms of Use and/or comply with legal requirements.&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Opting out of email marketing:&nbsp;</strong>You can unsubscribe from our marketing email list at any time by clicking on the unsubscribe link in the emails that we send or by contacting us using the details provided below. You will then be removed from the marketing email list &ndash; however, we will still need to send you service-related emails that are necessary for the administration and use of your account. To otherwise opt-out, you may:&nbsp;&nbsp;</p>\r\n\r\n<p>■ Access your account settings and update preferences.</p>\r\n\r\n<p><strong>9. CONTROLS FOR DO-NOT-TRACK FEATURES</strong><strong>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p>Most web browsers and some mobile operating systems and mobile applications include a Do-Not-Track (&ldquo;DNT&rdquo;) feature or setting you can activate to signal your privacy preference not to have data about your online browsing activities monitored and collected. No uniform technology standard for recognizing and implementing DNT signals has been finalized. As such, we do not currently respond to DNT browser signals or any other mechanism that automatically communicates your choice not to be tracked online. If a standard for online tracking is adopted that we must follow in the future, we will inform you about that practice in a revised version of this Privacy Policy.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>Yes, if you are a resident of California, you are granted specific rights regarding access to your personal information.&nbsp;</em>&nbsp;</p>\r\n\r\n<p>California Civil Code Section 1798.83, also known as the &ldquo;Shine The Light&rdquo; law, permits our users who are California residents to request and obtain from us, once a year and free of charge, information about categories of personal information (if any) we disclosed to third parties for direct marketing purposes and the names and addresses of all third parties with which we shared personal information in the immediately preceding calendar year. If you are a California resident and would like to make such a request, please submit your request in writing to us using the contact information provided below.&nbsp;</p>\r\n\r\n<p>If you are under 18 years of age, reside in California, and have a registered account with the&nbsp;Sites, you have the right to request removal of unwanted data that you publicly post on the&nbsp;Sites. To request removal of such data, please contact us using the contact information provided below, and include the email address associated with your account and a statement that you reside in California. We will make sure the data is not publicly displayed on the&nbsp;Sites, but please be aware that the data may not be completely or comprehensively removed from our systems.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>11. DO WE MAKE UPDATES TO THIS POLICY?</strong></p>\r\n\r\n<p><strong><em>In Short:&nbsp;</em></strong><em>Yes, we will update this policy as necessary to stay compliant with relevant laws.</em></p>\r\n\r\n<p>We may update this privacy policy from time to time. The updated version will be indicated by an updated &ldquo;Revised&rdquo; date and the updated version will be effective as soon as it is accessible. If we make material changes to this privacy policy, we may notify you either by prominently posting a notice of such changes or by directly sending you a notification. We encourage you to review this privacy policy frequently to be informed of how we are protecting your information.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>12. HOW CAN YOU CONTACT US ABOUT THIS POLICY?</strong></p>\r\n\r\n<p>If you have questions or comments about this policy, you may&nbsp;email us at&nbsp;info@carish.ee&nbsp;or by phone # : +372 58777537.</p>', 3, '2020-03-01 12:55:11', '2020-11-17 06:32:26'),
(7, 3, 'Kuulutuste avaldamise poliitika', '<ul>\r\n	<li>Dubleeritud kuulutused pole lubatud.</li>\r\n	<li>Ettev&otilde;tte reklaamimine pole lubatud.</li>\r\n	<li>Postitage ainult oma v&otilde;i seaduslikult volitatud vara kuulutusi.</li>\r\n</ul>', 1, '2020-07-14 18:55:55', '2020-10-10 04:19:52'),
(8, 3, 'Ad publishing policy', '<ul>\r\n	<li>No <strong>duplicated ads</strong> are allowed</li>\r\n	<li><strong>Business promotion</strong> is not allowed</li>\r\n	<li>Only post ads of your <strong>own or legally authorized property</strong></li>\r\n</ul>', 2, '2020-07-14 18:55:55', '2020-10-10 04:17:08'),
(9, 3, 'Правила размещения объявлений', '<ul>\r\n	<li>Дублированные объявления не допускаются.</li>\r\n	<li>Реклама бизнеса не допускается.</li>\r\n	<li>Размещайте объявления только о вашей или законно доверенной собственности</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 3, '2020-07-14 18:55:55', '2020-10-10 04:22:08'),
(10, 4, 'Kuulutuste avaldamise poliitika', '<ul>\r\n	<li>Dubleeritud kuulutused pole lubatud.</li>\r\n	<li>Ettev&otilde;tte reklaamimine pole lubatud.</li>\r\n	<li>Postitage ainult oma v&otilde;i seaduslikult volitatud vara kuulutusi.</li>\r\n</ul>', 1, '2020-07-14 18:56:39', '2020-10-10 04:20:31'),
(11, 4, 'Spare part publishing policy', '<ul>\r\n	<li>No <strong>duplicated ads</strong> are allowed.</li>\r\n	<li><strong>Business promotion</strong> is not allowed.</li>\r\n	<li>Only post ads of your <strong>own or legally authorized property.</strong></li>\r\n</ul>', 2, '2020-07-14 18:56:39', '2021-01-18 18:34:33'),
(12, 4, 'Правила размещения объявлений', '<ul>\r\n	<li>Дублированные объявления не допускаются.</li>\r\n	<li>Реклама бизнеса не допускается.</li>\r\n	<li>Размещайте объявления только о вашей или законно доверенной собственности</li>\r\n</ul>', 3, '2020-07-14 18:56:39', '2020-10-10 04:22:28'),
(13, 5, 'Kuulutuste avaldamise poliitika', '<ul>\r\n	<li>Dubleeritud kuulutused pole lubatud.</li>\r\n</ul>', 1, '2020-07-14 18:58:04', '2020-10-10 04:23:01'),
(14, 5, 'Officer Services publishing policy', '<ul>\r\n	<li>No <strong>duplicated ads</strong> are allowed.</li>\r\n</ul>', 2, '2020-07-14 18:58:05', '2020-10-10 04:18:55'),
(15, 5, 'Правила размещения объявлений', '<ul>\r\n	<li>Дублированные объявления не допускаются.</li>\r\n</ul>', 3, '2020-07-14 18:58:05', '2020-10-10 04:23:01'),
(16, 6, 'Autode võrdlusest', '<p>V&otilde;rdlused moodustavad suure hulga m&otilde;tlemis- / uurimisprotsessi, mille l&auml;bime enne millegi ostmist. Kuna autod pole midagi, ostame iga p&auml;ev; range autode v&otilde;rdlus muutub &uuml;ha olulisemaks</p>', 1, '2020-09-22 05:10:16', '2020-12-27 06:04:12'),
(17, 6, 'About Car Comparison', '<p>Comparisons form a large chunk of thinking/research process we go through before purchasing anything. Since cars are not something, we buy every day; rigorous car comparisons become ever so more important.</p>', 2, '2020-09-22 05:10:16', '2020-12-27 05:56:11'),
(18, 6, 'О сравнении автомобилей', '<p>Сравнения составляют значительную часть мыслительного / исследовательского процесса, который мы проходим, прежде чем что-либо покупать. Поскольку автомобили - это не что-то, мы покупаем их каждый день; строгие сравнения автомобилей становятся все более важным</p>', 3, '2020-09-22 05:10:16', '2020-12-27 06:04:12'),
(19, 7, 'Autosildid', '<p><strong>Madal k&uuml;tusekulu: </strong></p>\r\n\r\n<p>ainult madala keskmise k&uuml;tusekuluga autod.</p>\r\n\r\n<p><strong>Madal l&auml;bis&otilde;it:</strong></p>\r\n\r\n<p>Autod, millel on v&auml;ike l&auml;bis&otilde;it.</p>\r\n\r\n<p><strong>Sertifitseeritud hooldus:</strong></p>\r\n\r\n<p>Autod, mida teenivad ainult ametnikud edasim&uuml;&uuml;jad. Sellele sildile saab taotleda valides sobiva kirjelduse kuulutuse postitamisel.</p>\r\n\r\n<p><strong>Hooldusajalugu:</strong></p>\r\n\r\n<p>Hooldusajalooga autod. Sellele sildile saab taotleda valides sobiva kirjelduse kuulutuse postitamisel.</p>\r\n\r\n<p><strong>Kiire m&uuml;&uuml;k:</strong></p>\r\n\r\n<p>Autod, mis vajavad kiiret m&uuml;&uuml;ki. Sellele sildile saab taotleda valides sobiva kirjelduse kuulutuse postitamisel.</p>\r\n\r\n<p><strong>Vahetuse v&otilde;imalus:</strong></p>\r\n\r\n<p>Autod, mida saab vahetada teiste autodega.Sellele sildile saab taotleda valides sobiva kirjelduse kuulutuse postitamisel.</p>', 1, '2020-09-24 15:11:18', '2020-10-10 04:09:58'),
(20, 7, 'Car tags', '<p><strong>Low fuel consumption:</strong></p>\r\n\r\n<p>Only cars with low average fuel consumption</p>\r\n\r\n<p><strong>Low mileage:</strong></p>\r\n\r\n<p>Cars that have low mileage.</p>\r\n\r\n<p><strong>Certified maintenance:</strong></p>\r\n\r\n<p>Cars that are only maintained by certified dealers. You can apply for this tag by selecting appropriate description while posting an add.</p>\r\n\r\n<p><strong>Service history maintained:</strong></p>\r\n\r\n<p>Cars with maintained service history. You can apply for this tag by selecting appropriate description while posting an add.</p>\r\n\r\n<p><strong>Urgent sale:</strong></p>\r\n\r\n<p>Cars that need to be sold urgently. You can apply for this tag by selecting appropriate description while posting an add.</p>\r\n\r\n<p><strong>Exchange possible:</strong></p>\r\n\r\n<p>Cars that can be exchanged with other cars. one can apply for this tag by selecting appropriate description while posting an add</p>', 2, '2020-09-24 15:11:18', '2020-10-10 04:09:58'),
(21, 7, 'Ярлыки автомобилей', '<p><strong>Низкий расход:</strong></p>\r\n\r\n<p>только автомобили с низким средним расходом топлива.</p>\r\n\r\n<p><strong>Малый пробег:</strong></p>\r\n\r\n<p>автомобили с небольшим пробегом.</p>\r\n\r\n<p><strong>Сертифицированное обслуживание:</strong></p>\r\n\r\n<p>автомобили, обслуживаемые только официальными дилерами. Вы можете подать заявку на этот ярлык, выбрав соответствующее описание при размещении объявления.</p>\r\n\r\n<p><strong>C историей обслуживания:</strong></p>\r\n\r\n<p>Автомобили с сохраненной историей обслуживания. Вы можете подать заявку на этот ярлык, выбрав соответствующее описание при размещении объявления.</p>\r\n\r\n<p><strong>Срочная продажа: </strong></p>\r\n\r\n<p>Автомобили, которые нужно срочно продать. Вы можете подать заявку на этот ярлык, выбрав соответствующее описание при размещении объявления.</p>\r\n\r\n<p><strong>Возможен обмен:</strong></p>\r\n\r\n<p>Машины, которые можно обменять на другие автомобили. Вы можете подать заявку на этот ярлык, выбрав соответствующее описание при размещении объявления.</p>\r\n\r\n<p>&nbsp;</p>', 3, '2020-09-24 15:11:18', '2020-10-10 04:12:00'),
(22, 8, 'Müüjate sildid', '<p><strong>Sertifitseeritud mehaanik:</strong></p>\r\n\r\n<p>Otsi sertifitseeritud automehaanikut (nt sertifitseeritud Honda v&otilde;i Kia mehaanikut). Mehaanikud saavad taoleda seda silti, kui neil on kvalifikatsiooni t&otilde;endid.</p>', 1, '2020-10-01 11:59:51', '2020-10-10 04:14:31'),
(23, 8, 'Dealer tags', '<p><strong>Certified mechanic:</strong></p>\r\n\r\n<p>Search for a certified car mechanic (e.g.certified Honda/Kia mechanic). Mechanics can apply for this tag if they have evidence to their qualification.</p>', 2, '2020-10-01 11:59:51', '2020-10-10 04:14:31'),
(24, 8, 'Ярлыки продавцов', '<p><strong>Сертифицированный механик:</strong></p>\r\n\r\n<p>Найти сертифицированного автомеханика (например, сертифицированного механика Honda или Kia). Механики могут подать заявку на получение этого ярлыка, если у них есть доказательства квалификации.</p>', 3, '2020-10-01 11:59:51', '2020-10-10 04:14:31'),
(25, 9, 'Meie sildid', '<p>Meie sildis&uuml;steem v&otilde;imaldab &uuml;ksikasjalikku otsingut. Sildid anname autodele v&otilde;i teenustele, mis vastavad alltoodud poliitikale.</p>', 1, '2020-10-10 04:26:48', '2020-10-10 04:26:48'),
(26, 9, 'Our tags', '<p>Our tag system allows users to have a detailed search. We give tags to cars or services that comply with the policy below.</p>', 2, '2020-10-10 04:26:48', '2020-10-10 04:26:48'),
(27, 9, 'Наши ярлыки', '<p>Наша система ярлыков позволяет выполнять детальный поиск. Ярлыки даются&nbsp;&nbsp;автомобилям или услугам соответствующим правилам ниже.</p>', 3, '2020-10-10 04:26:48', '2020-10-10 04:26:48'),
(28, 10, 'Kasulikud lingid', '<h3><a href=\"http://eteenindus.mnt.ee/public/soidukTaustakontroll.jsf\" target=\"_blank\">S&otilde;iduki taustakontroll:</a></h3>\r\n\r\n<p>Sellel veebilinkil leiate kogu teabe s&otilde;iduki kohta, mida kavatsete osta. Teave nagu s&otilde;iduki KW/CC, tehnilise kontrolli kehtivus, s&otilde;idukil l&auml;bitud l&auml;bis&otilde;it kuni viimase &uuml;levaatuseni ning millal ja mis juhtus s&otilde;iduki omandiga.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"https://www.lkf.ee/et/kahjukontroll\" target=\"_blank\">S&otilde;iduki kahjustuste kontroll:</a></h3>\r\n\r\n<p>Sellelt veebilinkilt leiate teavet selle kohta, et ostetav s&otilde;iduk on kunagi &otilde;nnetusse sattunud. Kui jah, siis kui raske see &otilde;nnetus oli ja kuidas selle &otilde;nnetuse eest maksti.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"http://www.lkf.ee/et/kalkulaator\" target=\"_blank\">Liikluskindlustuse kalkulaator:</a></h3>\r\n\r\n<p>Selle veebilingi abil saate aimu oma tulevase s&otilde;idukikindlustuse hinnast. Palun pange t&auml;hele, et see annab ainult hinnangu ja v&otilde;ib tegeliku ostmise ajal erineda.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"http://www.mnt.ee/et/kontaktid/teenindusburood\" target=\"_blank\">Maanteeameti teenindusb&uuml;rood:</a></h3>\r\n\r\n<p>Seda veebilinki saab kasutada teie l&auml;hedal asuva teedevalitsuse kontori leidmiseks.</p>', 1, '2020-12-28 09:25:25', '2021-08-17 07:15:06'),
(29, 10, 'Useful links', '<h3><a href=\"https://eteenindus.mnt.ee/public/soidukTaustakontroll.jsf\" target=\"_blank\">Vehicle background check</a><a href=\"http://eteenindus.mnt.ee/public/soidukTaustakontroll.jsf\" target=\"_blank\">:</a></h3>\r\n\r\n<p>On this weblink, you can find all the information regarding vehicle you are planning to buy. Information like KW/CC of the vehicle, Technical inspection validity, Mileage driven by vehicle till last inspection and when and what happened with the ownership of vehicle.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"https://www.lkf.ee/et/kahjukontroll\" target=\"_blank\">Vehicle damage control:</a></h3>\r\n\r\n<p>On this weblink, you can find information that the vehicle you are planning to buy is ever involved in any accident. If so then how severe&nbsp;was that accident and how paid the cost for that accident.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"https://www.lkf.ee/et/kalkulaator\" target=\"_blank\">Traffic insurance calculator</a><a href=\"http://www.lkf.ee/et/kalkulaator\" target=\"_blank\">:</a></h3>\r\n\r\n<p>This weblink can be used to get an idea of&nbsp;your future vehicle road&nbsp;insurance price. Kindly note that it will only provide an estimate and may vary at the time of actual buy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"https://www.mnt.ee/et/kontaktid/teenindusburood\" target=\"_blank\">Road Administration service offices</a><a href=\"http://www.mnt.ee/et/kontaktid/teenindusburood\" target=\"_blank\">:</a></h3>\r\n\r\n<p>This weblink can be used to find a road administration service office near you.&nbsp;</p>', 2, '2020-12-28 09:25:25', '2021-08-17 07:13:18'),
(30, 10, 'Полезные ссылки', '<h3><a href=\"http://eteenindus.mnt.ee/public/soidukTaustakontroll.jsf\" target=\"_blank\">Проверка автомобиля:</a></h3>\r\n\r\n<p>По этой ссылке вы можете найти всю информацию об автомобиле, который вы планируете купить. Такая информация, как KW / CC транспортного средства, срок действия технического осмотра, пробег транспортного средства до последнего осмотра, а также когда и что произошло с владельцем транспортного средства.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"http://www.lkf.ee/et/kahjukontroll\" target=\"_blank\">Контроль повреждений транспорта:</a></h3>\r\n\r\n<p>По этой ссылке вы можете найти информацию о том, что автомобиль, который вы планируете купить, когда-либо попадал в аварию. Если да, то насколько серьезной была эта авария и как она была оплачена.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"http://www.lkf.ee/et/kalkulaator\" target=\"_blank\">Калькулятор дорожного страхования:</a></h3>\r\n\r\n<p>Эту веб-ссылку можно использовать, чтобы получить представление о будущей стоимости дорожного страхования вашего транспортного средства. Обратите внимание, что это будет только приблизительная оценка и может измениться во время фактической покупки.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><a href=\"http://www.mnt.ee/et/kontaktid/teenindusburood\" target=\"_blank\">Офисы службы Департамента шоссейных дорог:</a></h3>\r\n\r\n<p>По этой ссылке можно найти ближайший к вам офис дорожной администрации.</p>', 3, '2020-12-28 09:25:25', '2021-08-17 07:15:06'),
(31, 11, 'About Us', '<p><strong>Missioon</strong><br />\r\nCarishi meeskonna eesm&auml;rk on luua veebikeskkond, kus selle kasutajad saaksid leida potentsiaalseid ostjaid oma kasutatud autodele ja otsida ka uusi autosid Carishi kinnitatud kasutajatelt. Meie platvormi kasutades saavad kasutajad leida teiste kasutajate/ettev&otilde;tete pakutavaid autoosi ning leida ka autodega seotud teenuseid, nagu sertifitseeritud mehaanikud, s&otilde;idukite tehno&uuml;levaatuskeskused ja parkimiskohad. Meie lahendus areneb l&otilde;puks igas auto&auml;ri dimensioonis, mis muudab meie potentsiaalse kasutaja elu lihtsaks.<br />\r\n<br />\r\n<strong>P&otilde;hjus, miks valida carish:</strong></p>\r\n\r\n<ul>\r\n	<li>Kasutajas&otilde;bralik liides</li>\r\n	<li>Tasuta kasutada</li>\r\n	<li>Kinnitatud kasutajad</li>\r\n	<li>Ajakohane automudelite andmebaas</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Meie omadused:</strong></p>\r\n\r\n<ul>\r\n	<li>tasuta autokuulutuste postitamine</li>\r\n	<li>kasutatud autode otsimine</li>\r\n	<li>tasuta varuosade kuulutuse postitamine</li>\r\n	<li>kasutatud ja uute varuosade otsing</li>\r\n	<li>Otsige s&otilde;idukitega seotud teenuseid, nagu sertifitseeritud mehaanikud, parklad, pesuruumid,autokoolid ja palju muud.</li>\r\n	<li>Autode v&otilde;rdlus</li>\r\n</ul>', 1, '2021-12-27 04:13:34', '2021-12-27 04:13:34'),
(32, 11, 'About Us', '<p><strong>Mission.</strong><br />\r\nCarish team is on a mission to create an online environment where it&#39;s users can find potential buyers for their used cars and also can search for new cars from carish verified users. Using our platform, users can find auto-parts offered by other users / businesses and can also find car related services like certified mechanics,vehicle technical inspection centres and places to park their vehicle . Our solution will eventually evalve in every dimension of auto business that will make our potential user&rsquo;s life easy.</p>\r\n\r\n<p><strong>Reason to choose carish :</strong></p>\r\n\r\n<ul>\r\n	<li>User friendly interface&nbsp;</li>\r\n	<li>Free to use&nbsp;</li>\r\n	<li>Verified users</li>\r\n	<li>Up to date car models database</li>\r\n</ul>\r\n\r\n<p><strong>Our features:</strong></p>\r\n\r\n<ul>\r\n	<li>free car ad posting</li>\r\n	<li>used car searching</li>\r\n	<li>free Spare part ad posting</li>\r\n	<li>used and new spare part searching</li>\r\n	<li>Search for vehicle related services like certified mechanics , parking lots, washing areas,driving schools and much more.</li>\r\n	<li>Car comparison</li>\r\n</ul>', 2, '2021-12-27 04:13:34', '2021-12-27 04:13:34'),
(33, 11, 'About Us', '<p><strong>Миссия.</strong><br />\r\nКоманда Carish ставит перед собой задачу создать онлайн-среду, в которой пользователи могут находить потенциальных покупателей для своих подержанных автомобилей, а также могут искать новые автомобили от проверенных carish пользователей. Используя нашу платформу, пользователи могут найти автозапчасти, предлагаемые другими пользователями / предприятиями, а также найти услуги, связанные с автомобилем, такие как сертифицированные механики, центры технического осмотра транспортных средств и места для парковки своих автомобилей. Наше решение в конечном итоге будет оцениваться во всех аспектах автомобильного бизнеса, что облегчит жизнь нашим потенциальным пользователям.<br />\r\n<br />\r\n<strong>Причина выбрать carish:</strong></p>\r\n\r\n<ul>\r\n	<li>Дружественный интерфейс</li>\r\n	<li>Бесплатное использование</li>\r\n	<li>Проверенные пользователи</li>\r\n	<li>Актуальная база данных моделей автомобилей</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Наши особенности:</strong></p>\r\n\r\n<ul>\r\n	<li>бесплатное размещение автомобильной рекламы</li>\r\n	<li>поиск подержанной машины</li>\r\n	<li>бесплатное размещение объявления о запчастях</li>\r\n	<li>поиск подержанных и новых запчастей</li>\r\n	<li>Поиск услуг, связанных с автомобилем, таких как сертифицированные механики, парковки, места для мойки, aвтошколы и многое другое.</li>\r\n	<li>Сравнение автомобилей</li>\r\n</ul>', 3, '2021-12-27 04:13:34', '2021-12-27 04:13:34');
