(131, 59, 'Royal Bloom APC is a versatile all-purpose cleaner that cuts through all levels of dirt, grease, and grime with the power of natural citrus inside, outside, or even underneath your & vehicle restores a crisp OEM sheen. Clean dashboards, door panels, steering wheels, shift knobs, vinyl seats, glass, LCD screens, and more.\r\n\r\nDirections:-\r\n\r\n     Spray Total Interior Cleaner & Protectant on dirty surfaces.\r\n    Wipe up dirt, grime, and contamination with a microfiber towel or agitate filth from cloth, carpet, or upholstery with a soft brush.\r\n    Gently wipe the interior surface to remove dirt, dust, and body oils\r\n    Once the surface is cleaned, flip over the microfiber towel to a clean side and buff off any excess product.', 2, '2022-03-04 05:22:32', '2022-03-04 05:22:32'),
(132, 59, 'Royal Bloom APC on mitmekülgne universaalne puhastusvahend, mis eemaldab kõik mustuse, rasva ja mustuse tasemed looduslike tsitruseliste jõuga teie ja sõiduki sees, väljas või isegi all ning taastab originaalse originaalseadmete tootja läike. Puhastage armatuurlauad, uksepaneelid, roolid, käigukangi nupud, vinüülistmed, klaasid, LCD-ekraanid ja palju muud.\r\n\r\nJuhised: -\r\n\r\n     Pihustage Total Interior Cleaner & Protectanti määrdunud pindadele.\r\n    Pühkige mustus, mustus ja saaste mikrokiudrätikuga või raputage mustus riidelt, vaibalt või polstrilt pehme harjaga.\r\n    Pühkige õrnalt sisepinda, et eemaldada mustus, tolm ja kehaõlid\r\n    Kui pind on puhastatud, keerake mikrokiust rätik puhtale küljele ja poleerige üleliigne toode.', 1, '2022-03-04 05:24:25', '2022-03-04 05:24:25'),
(133, 59, 'Royal Bloom APC — это универсальное универсальное чистящее средство, которое удаляет все уровни грязи, жира и копоти благодаря силе натуральных цитрусовых внутри, снаружи или даже под днищем вашего автомобиля и восстанавливает четкий оригинальный блеск. Очищайте приборные панели, дверные панели, рулевые колеса, ручки переключения передач, виниловые сиденья, стекла, ЖК-экраны и многое другое.\r\n\r\nНаправления:-\r\n\r\n     Распылите Total Interior Cleaner & Protectant на грязные поверхности.\r\n    Сотрите грязь, грязь и загрязнения полотенцем из микрофибры или встряхните грязь с ткани, ковра или обивки мягкой щеткой.\r\n    Аккуратно протрите внутреннюю поверхность, чтобы удалить грязь, пыль и кожный жир.\r\n    Как только поверхность будет очищена, переверните полотенце из микрофибры на чистую сторону и отполируйте излишки продукта.', 3, '2022-03-04 05:24:25', '2022-03-04 05:24:25'),
(134, 60, 'Microfiber Cleaning Kit Detail:\r\n\r\nDesign: 9-Piece Microfibre Cleaning Kit\r\nColour: Grey\r\n\r\nSuper soft microfibre lifts out dirt & dust\r\nStreak-free results\r\nMachine washable\r\n\r\n\r\nKit includes:\r\n\r\n    3 x applicator pads\r\n    3 x cloths\r\n    1 x 2-in-1 wash scrub pad\r\n    1 x microfibre wash mitt\r\n    1 x wheel brush', 2, '2022-03-04 05:26:20', '2022-03-04 05:26:20'),
(135, 60, 'Mikrokiust puhastuskomplekti üksikasjad:\r\n\r\nDisain: 9-osaline mikrokiust puhastuskomplekt\r\nVärv: hall\r\n\r\nÜlimalt pehme mikrokiud eemaldab mustuse ja tolmu\r\nTriipudeta tulemused\r\nMasinpestav\r\n\r\n\r\nKomplekt sisaldab:\r\n\r\n    3 x aplikaatorpadjakesed\r\n    3x lapid\r\n    1 x 2-in-1 pesu puhastuslapp\r\n    1 x mikrokiust pesukinnas\r\n    1 x rattahari', 1, '2022-03-04 05:26:41', '2022-03-04 05:26:41'),
(136, 60, 'Деталь комплекта для чистки микрофибры:\r\n\r\nДизайн: набор для чистки из микроволокна, 9 предметов\r\nЦвет: серый\r\n\r\nСверхмягкая микрофибра удаляет грязь и пыль.\r\nРезультаты без полос\r\nМожно стирать в машине\r\n\r\n\r\nВ комплект входят:\r\n\r\n    3 аппликатора\r\n    3 х салфетки\r\n    1 подушечка-скраб 2-в-1\r\n    1 х мочалка из микрофибры\r\n    1 х колесная щетка', 3, '2022-03-04 05:26:42', '2022-03-04 05:26:42'),
(137, 61, 'Car Geek All-purpose cleaner is a new product for every car lover.\r\n\r\nCar Geek All Purpose Cleaner is formulated with high-end luxury vehicles in mind, it uses biological enzymes to decompose stains, and achieve a clean, more environmentally friendly, and non-toxic effect.\r\n\r\nThis allows even the finest and most delicate of the car interior to be cleaned without fear of fading, cracking, or stiffening with age.', 2, '2022-03-04 08:26:35', '2022-03-04 08:26:35'),
(138, 61, 'Car Geek Universaalne puhastusvahend on uus toode igale autosõbrale.\r\n\r\nCar Geek All Purpose Cleaner on loodud tippklassi luksussõidukeid silmas pidades, see kasutab bioloogilisi ensüüme plekkide lagundamiseks ja puhta, keskkonnasõbralikuma ja mittetoksilise efekti saavutamiseks.\r\n\r\nSee võimaldab puhastada isegi kõige peenemaid ja õrnemaid autosalonge, kartmata pleekimist, pragunemist või vananedes jäigemaks muutumist.', 1, '2022-03-04 08:28:23', '2022-03-04 08:28:23'),
(139, 61, 'Универсальный очиститель Car Geek — новинка для каждого автолюбителя.\r\n\r\nУниверсальное чистящее средство Car Geek разработано специально для автомобилей класса люкс. В нем используются биологические ферменты для разложения пятен и достижения более чистого, экологически чистого и нетоксичного эффекта.\r\n\r\nЭто позволяет очищать даже самые тонкие и деликатные элементы салона автомобиля, не опасаясь выцветания, растрескивания или жесткости с возрастом.', 3, '2022-03-04 08:28:23', '2022-03-04 08:28:23'),
(140, 62, 'U Shape Gel Foam Cool Seat Cushion.\r\nDesigned to relieve sciatica and tailbone pain from sitting. \r\nAlleviates fatigue by reducing strain on the muscle.\r\n\r\nNatural cooling gel absorbs heat from your body and replaces with the cooling sensation.\r\nSpecial design adjustable strap on the back for the office chair or car seat to maintain the perfect position. \r\nFree washable cover. \r\nAllow air to circulate.\r\nAbsorbs pressure points. \r\nPerfect for Car seats, Office Chairs, Home use, etc.', 2, '2022-03-08 07:47:57', '2022-03-08 07:47:57'),
(141, 63, 'Universal Mobile holder \r\n\r\nMount on center mirror \r\n\r\nAdjustable for mobile \r\n\r\nWon\'t Disturb car view while driving', 2, '2022-03-08 07:53:18', '2022-03-08 07:53:18'),
