(191, 85, 'Gladiator Scratch Remover helps remove fine scratches, swirls and haze from all auto paint finishes. \r\nIt can also remove minor paint marks and water spotting quickly and easily.\r\nIt restores paint color, making paint finishes look like new and wont scratch clear coat paint like conventional rubbing compounds.\r\nexclusive non-abrasive liquid formulation is convenient and easy to use.\r\nSo why not grab this deal right away? Place  your order now .', 2, '2022-07-19 07:07:17', '2022-07-19 07:07:17'),
