(220, 98, 'The Interior Shiner is the most important car care product that you must own! This amazing car Interior Shiner is what will give your car the new shine back. The special interior formula will not only revitalize your car’s interior but protect it from extra damage caused by sun exposure. Parking your car under the sun can leave your car interior to suffer sun exposure damage, the FalconX Interior Shiner protects your car’s interior from rusting, oxidizing, and fading against such elements.\r\nIt not only protects your car from damage but gives it its original shine and color back! With just one coat you can make your car look new in seconds! If you want a glossy finish make sure to apply a liberal coat to your car’s interior.', 2, '2022-09-10 10:21:51', '2022-09-10 10:21:51'),
(221, 99, 'Save your money and get the Multi-Purpose Cleaner that not only keeps your car clean but protects it from the accumulation of dust and oily handprints. The Foam Action formula brings out the interior\'s original color and vibrancy back that was faded due to sun exposure or overuse. It also prevents any future rusting and oxidizing of your car interior while protecting against harsh elements.\r\nWith just one multi-purpose car cleaner make your car look new, shiny, and clean in no time! It not only protects your car from damage but gives it its original shine and color back!', 2, '2022-09-10 10:23:54', '2022-09-10 10:23:54'),
(222, 100, 'Save your money and get the Multi-Purpose Cleaner that not only keeps your car clean but protects it from the accumulation of dust and oily handprints. The Foam Action formula brings out the interior\'s original color and vibrancy back that was faded due to sun exposure or overuse. It also prevents any future rusting and oxidizing of your car interior while protecting against harsh elements.\r\nWith just one multi-purpose car cleaner make your car look new, shiny, and clean in no time! It not only protects your car from damage but gives it its original shine and color back!', 2, '2022-09-10 10:27:31', '2022-09-10 10:27:31'),
(223, 101, 'Absorbs huge amounts of water to give your vehicle a complete all over clean.\r\n\r\nEasy grip\r\nHeavy-duty quality for tough jobs\r\nLightweight\r\nExtra thick and super absorbent\r\nMultipurpose and ideal for home use as well\r\nGreat for washing all car surfaces including bodywork, glass, plastic, and bumper.', 2, '2022-09-10 10:28:42', '2022-09-10 10:28:42'),
(224, 102, 'Fine leather requires special attention and care, especially when it’s subjected to the intense sun, heat and humidity in your car.\r\n\r\nOur rich, luxurious Leather Care Gel pampers and conditions fine leathers to protect and preserve their rich, supple, natural appearance. \r\nOur advanced leather formula.', 2, '2022-09-10 10:30:10', '2022-09-10 10:30:10'),
(225, 103, 'ArmorAll Shield For Wheels repels brake dust, road grime, and dirt by forming a protective barrier on wheel and rims. Easy to build up and difficult to wash off, brake dust has been the bane of beautiful, shiny wheels since the invention of disc brakes. \r\n\r\nSimply spray ArmorAll Wheel Protectant on clean, dry wheels to repel brake dust, road grime, and dirt.\r\n\r\nThe invisible barrier lasts up to four weeks, keeping your wheels clean from wash to wash. Armor All Extreme Shield Wax is even better than wax. Its protective shield prevents dirt and grime from sticking to your car.', 2, '2022-09-10 10:31:24', '2022-09-10 10:31:24'),
(226, 104, 'Your car’s carpet and upholstery take a serious beating from stains and ground-in dirt.\r\nOxi Magic® cleaner brings fabric back to life, restoring its plush, luxurious beauty.\r\nA breakthrough in cleaning technology, it uses oxygen action to power through the most stubborn stains, and begins dissolving them on contact.\r\nDissolves the toughest automotive stains – like mud, coffee, cola, ink, grass and motor oil.\r\nFor Carpet/Fabric Surfaces: Check for colorfastness before using.. Soak up any excess liquid or residue from stain.\r\nSpray product directly on stain..', 2, '2022-09-10 10:32:30', '2022-09-10 10:32:30'),
(227, 105, 'Suggested Applications: Wheel wells (Space above tire), rocker panels (underneath Car Door), frames and under body, body repairs, rust holes, tree pruning, driveway cracks, minor repairs, post preserver.\r\nProtects fenders, frames, fuel tanks, door panels, rocker panels, hoods and firewalls against moisture, road salt and corrosion', 2, '2022-09-10 10:33:34', '2022-09-10 10:33:34'),
