(229, 107, 'Smartec Electric Blower And Vacuum Cleaner - 850W\r\n\r\nSmartec bring both a blower and a vacuum cleaner 2 in 1. Enjoy the flexibility and versatility of the two-in-one design, which can quickly blow away leaves and suck dust and pet hairs. The Smartec blower variable-speed motor of the blower provides superior efficiency and control, driving up to 13000 RPM at no-load speed. The speed of the blower will change with the change of the pressing force.\r\n\r\nModel: ST-23501\r\n\r\nBrand: Smar-tec\r\n\r\nBody material: Strong Plastic\r\n\r\nColor: Orange & Balck\r\n\r\nRated Power Input: 850W\r\n\r\nNo-load speed: 13000 RPM', 2, '2022-09-10 10:35:41', '2022-09-10 10:35:41'),
