(236, 108, 'STP Oil Treatment - 443ml\r\n\r\nSTP Oil Treatment Petrol fortifies motor oil with an extra measure of additives which includes viscosity improver plus anti-wear, anti-friction and anti-oxidation agents. STP Oil Treatment for Petrol Engines provides extra protection against engine heat and allows oil to maintain key lubricating properties for longer to keep the engine going strong until the next oil change.\r\n\r\nSo why not grab this deal right away? Place your orders now.', 2, '2022-09-10 10:57:03', '2022-09-10 10:57:03'),
