(239, 104, 'Your car’s carpet and upholstery take a serious beating from stains and ground-in dirt.\r\nOxi Magic® cleaner brings fabric back to life, restoring its plush, luxurious beauty.\r\nA breakthrough in cleaning technology, it uses oxygen action to power through the most stubborn stains, and begins dissolving them on contact.\r\nDissolves the toughest automotive stains – like mud, coffee, cola, ink, grass and motor oil.\r\nFor Carpet/Fabric Surfaces: Check for colorfastness before using.. Soak up any excess liquid or residue from stain.\r\nSpray product directly on stain..', 1, '2022-09-10 11:03:48', '2022-09-10 11:03:48'),
(240, 104, 'Your car’s carpet and upholstery take a serious beating from stains and ground-in dirt.\r\nOxi Magic® cleaner brings fabric back to life, restoring its plush, luxurious beauty.\r\nA breakthrough in cleaning technology, it uses oxygen action to power through the most stubborn stains, and begins dissolving them on contact.\r\nDissolves the toughest automotive stains – like mud, coffee, cola, ink, grass and motor oil.\r\nFor Carpet/Fabric Surfaces: Check for colorfastness before using.. Soak up any excess liquid or residue from stain.\r\nSpray product directly on stain..', 3, '2022-09-10 11:03:48', '2022-09-10 11:03:48'),
(241, 103, 'ArmorAll Shield For Wheels repels brake dust, road grime, and dirt by forming a protective barrier on wheel and rims. Easy to build up and difficult to wash off, brake dust has been the bane of beautiful, shiny wheels since the invention of disc brakes. \r\n\r\nSimply spray ArmorAll Wheel Protectant on clean, dry wheels to repel brake dust, road grime, and dirt.\r\n\r\nThe invisible barrier lasts up to four weeks, keeping your wheels clean from wash to wash. Armor All Extreme Shield Wax is even better than wax. Its protective shield prevents dirt and grime from sticking to your car.', 1, '2022-09-10 11:04:12', '2022-09-10 11:04:12'),
(242, 103, 'ArmorAll Shield For Wheels repels brake dust, road grime, and dirt by forming a protective barrier on wheel and rims. Easy to build up and difficult to wash off, brake dust has been the bane of beautiful, shiny wheels since the invention of disc brakes. \r\n\r\nSimply spray ArmorAll Wheel Protectant on clean, dry wheels to repel brake dust, road grime, and dirt.\r\n\r\nThe invisible barrier lasts up to four weeks, keeping your wheels clean from wash to wash. Armor All Extreme Shield Wax is even better than wax. Its protective shield prevents dirt and grime from sticking to your car.', 3, '2022-09-10 11:04:12', '2022-09-10 11:04:12'),
