(103, 69, 'ArmorAll Shield for Wheels - 300ml', '2272410', 1, 46, 258, 2000.00, 0, 0, 'New', 'ArmorAll Shield For Wheels repels brake dust, road grime, and dirt by forming a protective barrier on wheel and rims. Easy to build up and difficult to wash off, brake dust has been the bane of beautiful, shiny wheels since the invention of disc brakes. \r\n\r\nSimply spray ArmorAll Wheel Protectant on clean, dry wheels to repel brake dust, road grime, and dirt.\r\n\r\nThe invisible barrier lasts up to four weeks, keeping your wheels clean from wash to wash. Armor All Extreme Shield Wax is even better than wax. Its protective shield prevents dirt and grime from sticking to your car.', 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ahsan Company', 'mr.elahi.ehsan@gmail.com', '2299886655', 1, '2022-12-25 23:59:59', 'false', NULL, 1, '2022-09-10 10:31:24', '2022-09-16 14:07:26'),
(104, 69, 'OxiMagic Carpet & Upholstery Cleaner', '2135355', 1, 46, 258, 1099.00, 0, 0, 'New', 'Your car’s carpet and upholstery take a serious beating from stains and ground-in dirt.\r\nOxi Magic® cleaner brings fabric back to life, restoring its plush, luxurious beauty.\r\nA breakthrough in cleaning technology, it uses oxygen action to power through the most stubborn stains, and begins dissolving them on contact.\r\nDissolves the toughest automotive stains – like mud, coffee, cola, ink, grass and motor oil.\r\nFor Carpet/Fabric Surfaces: Check for colorfastness before using.. Soak up any excess liquid or residue from stain.\r\nSpray product directly on stain..', 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ahsan Company', 'mr.elahi.ehsan@gmail.com', '2299886655', 1, '2022-12-25 23:59:59', 'false', NULL, 1, '2022-09-10 10:32:30', '2022-09-16 14:07:28'),
